Ext.data.JsonP['Dashboard_4.10.0_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.10.0  - 6 February 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p></div>\n        <div class=\"header\"/>\n\n        <div id=\"src-49155817\" class=\"content\">\n                        <h1>Dashboard 4.10.0  - 6 February 2017</h1>\n    <p>Dashboard 4.10.0 is a minor release which includes several bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-49155817_Dashboard4.10.0ReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>App Analytics Events page causing the browser to hang for apps with a high number of feature events    </p>\n</li><li class=\" \">    <p>Performance Management key generation for APS SDK apps<del class=\" \"><br/></del>    </p>\n</li><li class=\" \">    <p>Invited users not being added to orgs once they have activated    </p>\n</li><li class=\" \">    <p>New users may not have access to Appcelerator Marketplace    </p>\n</li><li class=\" \">    <p>Slow running analytics queries may show zero values instead of an appropriate error message    </p>\n</li><li class=\" \">    <p>Pagination of ArrowDB request and push notification logs    </p>\n</li><li class=\" \">    <p>Signing up and in using Github account    </p>\n</li><li class=\" \">    <p>Studio downloads of SOASTA and Crittercism modules    </p>\n</li><li class=\" \">    <p>ArrowDB datasources with a large number of Access Control Lists may not be able to page through table views    </p>\n</li><li class=\" \">    <p>Registering apps with analytics service    </p>\n</li><li class=\" \">    <p>Thumbnails were not shown for photos in ArrowDB UI    </p>\n</li><li class=\" \">    <p>ArrowDB datasources may not be able to be deleted    </p>\n</li><li class=\" \">    <p>Enabling demo data may cause browser to hang    </p>\n</li><li class=\" \">    <p>Pressing enter key during user activation may put UI in bad state    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49155817\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.10.0 Release Note"});